import React from 'react';
import styles from "./HomePage.css";
import profilePicture from './assets/Avnoor_Sidhu.jpg';

function NavBar() {
    return (
      <nav className="navbar">
        <a href="/" className="nav-link">Home</a>
        <a href="/" className="nav-link">Experience</a>
        <a href="/" className="nav-link">Projects</a>
        <a href="/" className="nav-link">Contact</a>
      </nav>
    );
  }

function HomePage() {
    return (
        <div className="HomePage">
            <div class="home">
                <div class="text-column">
                    <h1 className='header'>Hello, I am Avnoor</h1>
                    <p>I am a Software Engineer at FOCAL Lab. </p>
                </div>
                <div class="image-column">
                    <img src={profilePicture} alt="Profile Picture" className="img" />
                </div>
            </div>
            <div>
                <h3 className="experienceTitle">Experience</h3>
                <hr class="custom-line"></hr>
            </div>
        </div>
    );
  }

  export default HomePage;
